import React from 'react'
import firebase from "firebase/compat/app";


const Home = () => {
  const auth = firebase.auth();
  return (
    <div className='home'>
      <h1>Sign out</h1>
      <button onClick={() => auth.signOut()}> SIGN OUT </button>
    </div>
  )
}

export default Home
